import React from "react";

const Photo = props => {

    const styles = {
        photo: {
            width: "100%",
            height: "100%",
            cursor: "pointer",
            backgroundImage: "url("+props.url+")"
        }
    }

    return <img src={props.url} 
    style={styles.photo }
    alt="#">
    </img>

};

export default Photo;
